// @description  let's play solo:duo or solo:squad!
// @author       恋ポケ
// @match        http*://*surviv.io/*
// @grant        none
// @downloadURL https://update.greasyfork.org/scripts/376251/survivio%20soloduo%20solosquad%20shortcut.user.js
// @updateURL https://update.greasyfork.org/scripts/376251/survivio%20soloduo%20solosquad%20shortcut.meta.js
// ==/UserScript==

(function() {
    'use strict';
 var SQUAD = document.createElement("img");
    SQUAD.setAttribute("id","solo_squad");
    SQUAD.src = "data:image/png;base64,";
    SQUAD.style.display = "inline-block";
    SQUAD.style.width = "50%";
    SQUAD.onclick = function squad(){

  document.getElementById("btn-create-team").click();
  setTimeout(function(){
  document.getElementById("btn-team-queue-squad").click();
  document.getElementById("btn-team-fill-none").click();
  },750);
  setTimeout(function(){
  document.getElementById("btn-start-team").click();
    },950);
    };
document.getElementById("ad-block-left").insertBefore(SQUAD, document.getElementById("ad-block-left").firstChild);

 var DUO = document.createElement("img");
    DUO.setAttribute("id","solo_duo");
    DUO.src = "data:image/png;base64,";
    DUO.style.display = "inline-block";
    DUO.style.width = "50%";
    DUO.onclick = function duo(){
  document.getElementById("btn-create-team").click();
  setTimeout(function(){
  document.getElementById("btn-team-queue-duo").click();
  document.getElementById("btn-team-fill-none").click();
  },749);
  setTimeout(function(){
  document.getElementById("btn-start-team").click();
  },750);
  };
document.getElementById("ad-block-left").insertBefore(DUO, document.getElementById("ad-block-left").firstChild);
})();